USE OF CONFIDENTIAL INFORMATION
The Recipient agrees:
not to access, use, disclose or reproduce Confidential Information for any purpose other than the Purpose;
to maintain the confidential nature of Confidential Information; 
not, without the prior written consent of the Discloser, to disclose any Confidential information to any person other than its Authorised Representatives; 
at the request of the Discloser, to provide the Discloser with the name and title of each Authorised Representative to whom any Confidential Information has been disclosed; 
that it is wholly responsible for the acts or omissions of its Authorised Representatives and will procure that its Authorised Representatives do not do or omit to do anything which, if done or omitted to be done by the Recipient, would cause the Recipient to be in breach of its obligations under this Agreement;
to establish and maintain effective security measures to safeguard Confidential Information from unauthorised access, use, disclosure or reproduction; and
to immediately notify the Discloser of any suspected or actual unauthorised access, use, disclosure or reproduction of Confidential Information. 
Clause 2.1 does not apply to: 
Excluded Information; or
the disclosure of Confidential Information by the Recipient as required by any law or the rules of any securities exchange, or by any order of a government agency, provided that, before any such disclosure is made by the Recipient, reasonable notice is given to the Discloser and the Confidential Information disclosed is limited to prevent or minimise any potential damage to the Discloser.

2. USE OF CONFIDENTIAL INFORMATION
2.1 The Recipient agrees:
(a) not to access, use, disclose or reproduce Confidential Information for any purpose other than the Purpose;
(b) to maintain the confidential nature of Confidential Information; 
(c) not, without the prior written consent of the Discloser, to disclose any Confidential information to any person other than its Authorised Representatives; 
(d) at the request of the Discloser, to provide the Discloser with the name and title of each Authorised Representative to whom any Confidential Information has been disclosed; 
(e) that it is wholly responsible for the acts or omissions of its Authorised Representatives and will procure that its Authorised Representatives do not do or omit to do anything which, if done or omitted to be done by the Recipient, would cause the Recipient to be in breach of its obligations under this Agreement;
(f) to establish and maintain effective security measures to safeguard Confidential Information from unauthorised access, use, disclosure or reproduction; and
(g) to immediately notify the Discloser of any suspected or actual unauthorised access, use, disclosure or reproduction of Confidential Information. 
2.2 Clause 2.1 does not apply to: 
(a) Excluded Information; or
(b) the disclosure of Confidential Information by the Recipient as required by any law or the rules of any securities exchange, or by any order of a government agency, provided that, before any such disclosure is made by the Recipient, reasonable notice is given to the Discloser and the Confidential Information disclosed is limited to prevent or minimise any potential damage to the Discloser.

Article 10 (Exclusion of Anti Social Forces)
Each party may immediately terminate this Agreement without any notice in cases in which the other party falls under any of the following;
an organized crime group, a member of an organized crime group, association of an organized crime group, and any other equivalent person of above (hereinafter referred to as “Anti Social Forces”);
a person having such relationship with the Anti Social Forces that shows the Anti Social Forces' substantial involvement in the person's management or having a close relationship;
a person concludes this Agreement by allowing Anti Social Forces to utilize his/her name 
a person who themselves or through the use of third parties uses intimidating words or actions; or
a person who themselves or through the use of third parties damages the credit or obstructs the business of the other party by force or by the use of fraudulent.
In cases in which each party terminates this Agreement pursuant to the provision of the preceding paragraph, the party shall not be obligated to compensate the other party for the damages arising as a result thereof.

Article 10 (Exclusion of Anti Social Forces)
Each party may immediately terminate this Agreement without any notice in cases in which the other party falls under any of the following;
an organized crime group, a member of an organized crime group, association of an organized crime group, and any other equivalent person of above (hereinafter referred to as “Anti Social Forces”);
a person having such relationship with the Anti Social Forces that shows the Anti Social Forces' substantial involvement in the person's management or having a close relationship;
a person concludes this Agreement by allowing Anti Social Forces to utilize his/her name 
a person who themselves or through the use of third parties uses intimidating words or actions; or
a person who themselves or through the use of third parties damages the credit or obstructs the business of the other party by force or by the use of fraudulent.
In cases in which each party terminates this Agreement pursuant to the provision of the preceding paragraph, the party shall not be obligated to compensate the other party for the damages arising as a result thereof.

Confidentiality Obligations
Except as authorized in writing by the Disclosing Party, the Receiving Party shall:
use all Confidential Information only to evaluate the Opportunity; 
limit access to Confidential Information only to one or more of its directors, officers, employees, Affiliates, consultants, technology providers, advisors, and agents (collectively, “Representatives”) who have a need to access the Confidential Information to evaluate the Opportunity; 
advise its Representatives, by instruction or written agreement, who have access to the Confidential Information of the proprietary nature of the Confidential Information and that they must comply with the terms of this Agreement;
safeguard all Confidential Information by using a reasonable degree of care, but not less than the degree of care used by the Receiving Party in safeguarding its own similar information; 
immediately notify the Disclosing Party if it becomes aware of any loss or disclosure of any Confidential Information
not copy, change, or create other works from the Confidential Information except as necessary to evaluate the Opportunity;
not disclose any Confidential Information to third parties other than to its Representatives as allowed under this Agreement; and
not disclose the existence of the discussions relating to the Opportunity to any third party other than to its Representatives as allowed under this Agreement.

Exceptions to Confidentiality
The obligations of confidentiality and restrictions on use in this Agreement do not apply to any Confidential Information that:
the Receiving Party already knows without restriction at the time the Receiving Party got the information from the Disclosing Party;
the Receiving Party later learns from a third party free of any restriction and without breach of this Agreement;
becomes publicly available through no breach of this Agreement by the Receiving Party; or
is the same as any information the Receiving Party independently develops without use of any Confidential Information of the Disclosing Party.

Confidential Information
all information related to the business or intellectual property (including know - how) of a Party, of its Group Companies, or of its Authorised Persons, or related to the Purpose, that the Receiving Party receives or accesses as a result of any discussions or dealings under this Agreement, but not including information that: 
(i) is publicly available other than by breach of this Agreement; 
(ii) is lawfully in the possession of the Receiving Party before its disclosure under this Agreement; 
(iii) is disclosed to the Receiving Party through one or more third parties who are free to disclose it; or 
(iv) is developed independently of any Confidential Information;

Responsibilities Regarding Confidential Information. Recipient will:
hold Discloser’s Confidential Information in confidence and not disclose such Confidential Information to any third party;
not use or copy Discloser’s Confidential Information for any purpose except for the Purpose; 
take reasonable precautions (at least equivalent to those Recipient takes with respect to its own most highly confidential information (but in no event less than reasonable care)) to protect the secrecy of and prevent unauthorized disclosure or use of Discloser’s Confidential Information and will maintain source code in strict confidence for as long as it is in Recipient’s possession; and
not reverse engineer, disassemble, or de-compile any prototypes, software, or other tangible objects that embody discloser’s Confidential Information.
Nothing herein will obligation either party to proceed with any transaction, and each party reserves the right in its sole discretion, to terminate the discussions contemplated by this Agreement at any time upon written notice to the other party.

Exceptions to Confidentiality & Non-Use Obligations.  The Receiving Party will have no obligations under this Agreement with respect to a specific portion of the Disclosing Party’s Confidential Information if the Receiving Party can demonstrate with competent evidence that such portion of such Confidential Information:
at the time of its disclosure to the Receiving Party, was generally available to the public or otherwise part of the public domain; 
after its disclosure to the Receiving Party, became generally available to the public or otherwise part of the public domain, other than as a result of the Receiving Party’s breach of its obligations under this Agreement; 
at the time of its disclosure to the Receiving Party, was already known by the Receiving Party free of any obligation of confidence; 
after its disclosure to the Receiving Party, was disclosed to the Receiving Party free of any obligation of confidence by a third party who had no obligation to the Disclosing Party not to disclose such information to the Receiving Party; or 
was independently developed by or on behalf of the Receiving Party without the use of any of the Disclosing Party’s Confidential Information. 
Confidential Information disclosed to the Receiving Party hereunder will not be deemed to fall within the foregoing exceptions merely because broader or related information falls within such exceptions, nor will combinations of elements or principles be considered to fall within the foregoing exceptions merely because individual elements of such combinations fall within such exceptions.

Exceptions to Confidential Obligations. The obligations under this Agreement shall not apply to any information that: 
is in the public domain at the time of disclosure or subsequently enters the public domain without breach of this Agreement;
is already known to the receiving Party at the time of its disclosure, as shown by documents or other tangible evidence;
becomes known to the receiving Party without restriction on use or disclosure from a source other than the disclosing Party having the right to disclose the information; or
is independently developed by the receiving Party without reference to the Confidential Information, as shown by its written records.

Confidentiality obligations.  Each Recipient agrees:
not to use or disclose the Confidential Information of the Disclosing Party except for the purposes of advancing the Trial or with the prior written permission of the Disclosing Party;
to take precautions to secure and protect the Confidential Information of the Disclosing Party from unauthorized use or disclosure, that are at least as stringent as those observed by the Recipient to protect its own proprietary and valuable technologies and materials, but in any event, no less than reasonable precautions;
not to copy or otherwise reproduce or duplicate all or any portion of the Confidential Information of the Disclosing Party without the prior written permission of the Disclosing Party, except as necessary for the purposes of advancing the Trial;
to permit access to the Disclosing Party’s Confidential Information only to such of its directors, officers, employees, contractors and other members of the Recipient’s organization including (collectively, “Permitted Recipients”) as needed for the purposes of advancing the Trial, provided that the Recipient has taken appropriate action, whether by instruction, agreement or otherwise to inform the Permitted Recipients of the sensitive and confidential nature of the Confidential Information and to obtain their compliance with the terms and conditions of this Agreement, and provided that the Recipient will be liable for any breach of the terms of conditions of this Agreement by any of the Permitted Recipients;
to promptly advise the Disclosing Party in writing if any actual unauthorized use or disclosure or any anticipated unauthorized use or disclosure of all or any portion of the Disclosing Party’s Confidential Information comes to the attention of the Recipient and to take all reasonable steps to stop such use or disclosure; and
upon demand by the Disclosing Party, to either:
promptly return to the Disclosing Party all Confidential Information of the Disclosing Party in the possession or under the control of the Recipient, together with any copies thereof; or
promptly destroy (including permanently deleting such Confidential Information from all computer records) all Confidential Information of the Disclosing Party in the possession or under the control of the Recipient and to certify to the Disclosing Party as to such destruction.

Exceptions.  This Agreement will not restrict disclosure or use by either Recipient of Confidential Information that:  
was, at the time of receipt, otherwise known to the Recipient without restrictions as to use or disclosure; 
was in the public domain at the time of disclosure or thereafter enters into the public domain other than through the Recipient’s acts or omissions in violation of this Agreement; 
becomes known to the Recipient from a source other than the Disclosing Party, which source has no duty of confidentiality with respect to the information; or
is independently developed by the Recipient without reliance on or access to any Confidential Information of the Disclosing Party, as evidenced by the internal records of the Recipient relating to such development.

General Exclusions.
Notwithstanding the foregoing, the following will not constitute Confidential Information for purposes of this Agreement:
 (i)	information that was already in the Receiving Party’s possession before receipt from the Disclosing Party, as evidenced by written records, provided that such information was obtained lawfully and without an obligation of confidentiality to the Disclosing Party or another person or entity;
 (ii)	information that was obtained by the Receiving Party from a source other than the Disclosing Party, provided that such information was obtained lawfully and without an obligation of confidentiality to the Disclosing Party or another person or entity;
 (iii)	information that is or becomes generally available to the public, other than as a result of a disclosure by the Receiving Party; 
 (iv)	information that was independently developed by or for the Receiving Party without reference to the Disclosing Party’s Confidential Information, as evidenced by written records.
The exclusion under (iv) shall not apply to Confidential Information that constitutes Proprietary Information at the time of disclosure by UHS.

The  term “Confidential  Information”  shall  not include  any information that was:

a.   already known to the receiving Party before its disclosure hereunder, but only to the extent that the receiving Party’s prior knowledge is subject to disclosure obligations, if any, that are less  restrictive than the ones that apply to Confidential Information;
b.   in the public domain through no wrongful act of any person;
c.   rightfully obtained by the receiving Party from a third party without restriction
on disclosure and without a breach of any confidentiality obligation running
directly or indirectly to the Party;
d.   approved for release by a written authorization obtained by the receiving Party from the other Party in advance of release; or
e.   independently developed by the divulging Party without the use, directly or
indirectly, of any Confidential Information.

Exclusions to Confidential Information. No information shall be deemed Confidential Information, and the restrictions herein on use and disclosure shall not apply, to any information: 

which was known to the receiving party, as demonstrated through its written records, prior to the time of receipt under this Agreement; 
which is or becomes public or available to the general public other than through any act or default of the receiving party; 
which is used or disclosed with prior written approval of the disclosing party; 
which, without breach of this Agreement, was or is independently developed by the receiving party; or,
which is obtained by the receiving party from a third party who, to the best of receiving party's knowledge, is in lawful possession of such information and who did not acquire the same under an obligation of confidence directly or indirectly from the disclosing party.

(b)	Exceptions.  Notwithstanding the above, neither party shall have liability to the other with regard to any Confidential Information of the other which the receiving party can prove:
	(i)	was in the public domain at the time it was disclosed or has entered the public domain through no fault of the receiving party;
	(ii)	was known to the receiving party, without restriction, at the time of disclosure, as demonstrated by files in existence at the time of disclosure;
	(iii)	is disclosed with the prior written approval of the disclosing party;
	(iv)	was independently developed by the receiving party without any use of the Confidential Information of the disclosing party and by employees of the receiving party who have not had access to the Confidential Information, as demonstrated by files created at the time of such independent development;
	(v)	becomes known to the receiving party, without restriction, from a source other than the disclosing party without breach of this Agreement by the receiving party and otherwise not in violation of the disclosing party’s rights; or
	(vi)	is disclosed pursuant to the disclosure requirements of the Tennessee Open Records Act, or an order or requirement of a court, administrative agency, or other governmental body; provided, however, that the receiving party shall provide prompt notice of such court order or request for records to the disclosing party to enable the disclosing party to seek a protective order or otherwise prevent or restrict such disclosure.

Exceptions. Confidential Information does not include:
information that is, or becomes, generally available to the public other than as a result of breach of this Agreement;
information in the possession of the Receiving Party on a non-confidential basis prior to access or disclosure under this Agreement, as confirmed by documentary evidence;
information independently developed by the Receiving Party without any use of, or reference to, the Confidential Information, as confirmed by documentary evidence; or
information acquired in good faith from a third party, if such third party is not known by the Receiving Party to be prohibited from disclosing such information due to any obligation of confidence of any kind.

Confidential Information
Confidential Information shall mean all given information relating to the Project. The party disclosing Confidential Information shall hereinafter be referred to as the “Disclosing Party” and the party receiving  Confidential Information shall hereinafter be referred to as the “Receiving Party”.
For the purposes of this Agreement, information shall not be considered to be Confidential Information if such information;
was at the time of receipt publicly available or otherwise was in the public domain, other than by breach of this Agreement;
after receipt has been publicly available or otherwise has passed into the public domain, other than by faulty action or omission by the Receiving Party;
was known to the Receiving Party prior to disclosure by the Disclosing Party;
has been rightfully obtained from a third party which, as far as the Receiving Party knows, was not subject to any obligation of confidentiality, or
is generated or developed independently by the Receiving Party without reference to any Confidential Information.

Responsibilities Regarding Confidential Information. Recipient will:
hold Discloser’s Confidential Information in confidence and not disclose such Confidential Information to any third party;
not reverse engineer, disassemble, decompile, or design around Confidential Information without the Discloser’s written consent;
not use or copy Discloser’s Confidential Information for any purpose except for the Purpose; and
take reasonable precautions (at least equivalent to those Recipient takes with respect to its own similar information) to prevent unauthorized disclosure or use of Discloser’s Confidential Information and will maintain source code in strict confidence for as long as it is in Recipient’s possession.

Exceptions. The information shall not be deemed Confidential Information under this Agreement if such information:
is or becomes known in or accessible to the public domain;
is in the possession of the Recipient without restriction at the time of disclosure;
is used or disclosed with prior written approval of Discloser;
is independently developed by the Recipient without breach of this Agreement; or
is or becomes known to the Recipient without restriction and without breach of this Agreement or any other agreement.
In addition, it shall not be breach of the non- disclosure and confidentiality obligations of this Agreement if the Recipient discloses Confidential
Information pursuant to law or the order of any judicial or governmental authority, provided that, prior to disclosing any information pursuant to this clause, Recipient will seek to give reasonable prior notice to Discloser in order to provide Discloser with the opportunity to contest and/or limit such disclosure, and that any such disclosure is made pursuant to a suitable protective order and is otherwise given confidential treatment.

For purposes of this Agreement, the following terms shall have the meanings set out below:

(a)	“Authorised  Person(s)”  means  the  directors,  officers,  employees, agents,  representatives,  advisers  and  consultants  of  the  Receiving Party to whom disclosure of the Confidential Information is necessary in connection with the Subject Matter;

(b)	“Confidential   Information”   shall   mean   any   and   all   information, know-how,	ideas,   concepts,   techniques,   formulations,   technology (including  computer  software  and  hardware  products,  source  and

object codes, computer records, data bases, data processing and communications networking systems), industrial, marketing and commercial knowledge of a confidential nature and includes but is not limited to, commercial, legal, technical, factual, financial or tax information which contains or reveals amongst others, matters, trade secrets, know-how, patents, practices, processes and ancillary information and other proprietary or confidential information, regardless of form, format or media, including without limitation written, oral, or reduced to tangible product and also includes those communicated or obtained through meetings, documents, correspondence or inspection of tangible items, facilities or inspection at any site or place including without limitation:

(i)	research, development or technical information, confidential and proprietary product, intellectual property rights;

(ii)	business plans, strategies, projections, operations, systems or controls, financial and trading positions;

(iii)	details of customers, suppliers, contractors, debtors or creditors and of agreements and arrangements with third parties;

(iv)     information relating to officers, directors or employees of the
Disclosing Party;

(v)	contracts,  marketing  information,  brochures,  printed  matter, advertising rates and rate tables; and

(vi)	information relating to and matters arising from the existence or content	of   the   Parties’   communications,   discussions   or evaluations in connection with or pursuant to the Subject Matter.

All information, analyses, compilations, drawings, designs, notes, plans, reports, registers, summaries, studies, memoranda, board papers and other papers, research materials or other documents compiled, developed, derived, produced or recorded by or on behalf of the Receiving Party from any of the Confidential Information provided under this Agreement (collectively,	  the    “Derived    Information”)    shall    also    constitute Confidential	Information   and   accordingly,   the   obligations   in  this Agreement pertaining to Confidential Information shall in all respects apply to the Receiving Party vis-a-vis the Derived Information.

Confidentiality Undertakings

2.1	The Receiving Party understands and agrees that all Confidential Information is of a strictly secret and confidential nature.  The Receiving Party shall keep confidential and shall not disclose to any person:  
 
any Confidential Information;	

that discussions are taking place between the Disclosing Party and the Receiving Party concerning the Project nor the status, terms, conditions or other facts concerning such discussions nor the contents of any term sheet or memorandum of understanding or memorandum of agreement that has been signed or is in the course of being prepared, discussed or finalised, and/or;

(iii)	the identity of the Disclosing Party or the Receiving Party, whether by name or by any identifiable description in connection with the Disclosing Party’s actual or potential participation in the Project;  

except with the prior written consent of the Disclosing Party or as otherwise permitted by the terms and conditions of this Agreement. The Receiving Party shall make use of the Confidential Information disclosed by the Disclosing Party solely for the purposes of the Project or as otherwise provided in this Agreement, and (in any event and without limiting the generality of the foregoing) shall not use in any manner whatsoever, whether directly or indirectly, any of the Confidential Information for its own benefit or the benefit of any person or third party other than the Disclosing Party. 

2.2	The Receiving Party may disclose the Confidential Information to such of its Representatives only on a strict “need to know” basis and solely to the extent necessary to carry out the purposes of the Project. The Receiving Party shall be liable to ensure that each of its Representatives to whom Confidential Information is disclosed complies with the terms of this Agreement as if he or she was a party thereto, and prior to disclosure, is aware of and is legally bound by the confidentiality undertakings contained in this Agreement. A breach or threatened breach by any of the Representative shall be deemed to be a breach by the Receiving Party of the terms of this Agreement.

Exceptions

Notwithstanding the foregoing, the Receiving Party shall not be liable for the disclosure of Confidential Information to the extent it is:-

in or it enters the public domain, other than as a result of its breach of this Agreement or the non-compliance by any of its Representatives of the confidentiality undertakings contained in this Agreement; 

lawfully received by or known to the Receiving Party on a non-confidential basis from a source other than the Disclosing Party prior to disclosure as referred to in this Agreement; 

developed by the Receiving Party or any of its Representatives independently of, and without reference to or reliance on, the Confidential Information; and/or

compelled to be disclosed by the Receiving Party pursuant to any applicable law, legally enforceable judgment or order of court or a requirement of a stock exchange, government body or regulatory authority having supervision over it, provided however that the Receiving Party will:  

(to the extent permitted by law) promptly notify the Disclosing Party of the full details of such requirement and provide a copy of the proposed disclosure to the Disclosing Party as soon as possible and in any event before such disclosure in sufficient time in order that the Disclosing Party may make a contemporaneous announcement or public statement of its own of or relating to such disclosure, apply to court or the relevant authorities to prevent such disclosure, and/or take such other steps as it may reasonably deem necessary;

use its best efforts to secure confidential treatment of the Confidential Information; and

not effect any disclosure which is more extensive than required by the said law, judgment or order.

Treatment of Confidential Information.  With respect to Confidential Information disclosed under this Agreement, the Receiving Party (subject to the provisions of Section 3, below) shall:
use the Confidential Information solely for the purposes of evaluating a potential business relationship or transaction between the parties or, if any business relationship or transaction is entered into between the parties, use the Confidential Information solely for accomplishing the purposes of such business relationship or transaction and reproduce the Confidential Information only to the extent necessary for such purposes;
disclose the Confidential Information to its responsible Representatives, but only to the extent necessary to carry out the limited purpose of the disclosure pursuant to this Agreement; 
hold the Confidential Information in confidence, restrict disclosure of the Confidential Information solely to those Representatives with a need to know the Confidential Information and not disclose, transfer or offer to disclose or transfer any Confidential Information to any other person or entity, other than such Representatives, without the prior written consent of the Disclosing Party; and
be legally and financially responsible for any breach of this Agreement by any of its Representatives and shall, at its own expense, take all reasonable measures (including but not limited to court proceedings) to restrain its Representatives’ disclosure or use of the Confidential Information in violation of this Agreement.
The Receiving Party acknowledges and agrees that breach of this Agreement by the Receiving Party or its responsible Representatives may also constitute a violation of the Securities Exchange Act of 1934, the Insider Trading Sanctions Act of 1984, the Insider Trading and Securities Exchange Act of 1988 and/or other securities and other laws.

Exclusions from Confidential Information. The term “Confidential Information” as used in this Agreement shall not include information that:
at the time of disclosure is, or thereafter becomes, generally available to and known by the public other than as a result of, directly or indirectly, any breach of this Agreement by the Recipient or any of its Representatives; 
at the time of disclosure is, or thereafter becomes, available to the Recipient on a non-confidential basis from a third-party source, provided that, to the Recipient’s knowledge, such third party is not and was not prohibited from disclosing such Confidential Information to the Recipient by a contractual obligation to the Disclosing Party; 
was known by or in the possession of the Recipient or its Representatives, as established by documentary evidence, prior to being disclosed by or on behalf of the Disclosing Party pursuant to this Agreement; or 
was or is independently developed by the Recipient, as established by documentary evidence, without reference to or use of, in whole or in part, any of the Disclosing Party’s Confidential Information.

Recipient Obligations. For a period of two years following disclosure of Confidential Information and for an indefinite period of time following the disclosure of Trade Secrets, the Recipient shall:
protect and safeguard the confidentiality of all such Confidential Information with at least the same degree of care as the Recipient would protect its own Confidential Information, but in no event with less than a commercially reasonable degree of care;
not use the Disclosing Party’s Confidential Information, or permit it to be accessed or used, for any purpose other than the Purpose, unless such access or use is specifically authorized by the Disclosing Party, which authorization shall not be unreasonably withheld, conditioned or delayed;
not disclose any such Confidential Information to any person or entity, except to the Recipient’s Representatives who:
need to know the Confidential Information to assist the Recipient, or act on its behalf, in relation to the Purpose or to exercise its rights under the Agreement; 
are informed in writing by the Recipient of the confidential nature of the Confidential Information; and 
are subject to confidentiality duties or obligations to the Recipient that are no less restrictive than the terms and conditions of this Agreement; 
promptly notify the Disclosing Party of any unauthorized disclosure of Confidential Information or other breaches of this Agreement by the Recipient or its Representatives; and
be responsible for any breach of this Agreement caused by any of its Representatives.

Additional Confidentiality Obligations.  Except as permitted or required by this Agreement, or otherwise as mutually agreed to in writing by the Parties, neither Party shall, nor permit any of its Representatives to, disclose to any person:
the fact that the Parties have executed this Agreement;
that the Confidential Information has been made available to it or its Representatives by the Disclosing Party, or that it has inspected any portion of the Confidential Information; 
that discussions or negotiations may be, or are, underway between the Parties regarding the Confidential Information or the Purpose, including the status thereof; or 
any terms, conditions or other arrangements that are being discussed or negotiated in relation to the Confidential Information or the Purpose.

Confidential Information. Except as set forth in Section 2 below, "Confidential Information" means all non-public, confidential or proprietary information disclosed before, on or after the Effective Date, by either Party (a "Disclosing Party") to the other Party (a "Recipient") or its affiliates, or to any of such Recipient's or its affiliates' employees, officers, directors, partners, shareholders, agents, attorneys, accountants or advisors (collectively, "Representatives"), whether disclosed orally or disclosed or accessed in written, electronic or other form or media, and whether or not marked, designated or otherwise identified as "confidential," including, without limitation:
(a) all information concerning the Disclosing Party's and its affiliates', and their customers', suppliers' and other third parties' past, present and future business affairs including, without limitation, finances,
customer information, supplier information, products, services, organizational structure and internal practices, forecasts, sales and other financial results, records and budgets, and business, marketing, development, sales and other commercial strategies;
(b) the Disclosing Party's unpatented inventions, ideas, methods and discoveries, trade secrets, know-how, unpublished patent applications and other confidential intellectual property;
(c) all designs, specifications, documentation, components, source code, object code, images, icons, audiovisual components and objects, schematics, drawings, protocols, processes, and other visual
depictions, in whole or in part, of any of the foregoing;
(d) any third-party confidential information included with, or incorporated in, any information provided by the Disclosing Party to the Recipient or its Representatives; and
(e) all notes, analyses, compilations, reports, forecasts, studies, samples, data, statistics, summaries, interpretations and other materials (the "Notes") prepared by or for the Recipient or its Representatives that contain, are based on, or otherwise reflect or are derived from, in whole or in part, any of the foregoing.

Exclusions from Confidential Information. Except as required by applicable federal, state or local law or regulation, the term "Confidential Information" as used in this Agreement shall not include information that:
(a) at the time of disclosure is, or thereafter becomes, generally available to and known by the public other than as a result of, directly or indirectly, any violation of this Agreement by the Recipient or any of its Representatives;
(b) at the time of disclosure is, or thereafter becomes, available to the Recipient on a non- confidential basis from a third-party source, provided that such third party is not and was not prohibited from disclosing such Confidential Information to the Recipient by a legal, fiduciary or contractual obligation to the Disclosing Party;
(c) was known by or in the possession of the Recipient or its Representatives, as established by documentary evidence, prior to being disclosed by or on behalf of the Disclosing Party pursuant to this Agreement; or
(d) was or is independently developed by the Recipient, as established by documentary evidence, without reference to or use of, in whole or in part, any of the Disclosing Party's Confidential Information.

"Recipient Obligations. The Recipient shall:
(a) protect and safeguard the confidentiality of all such Confidential Information with at least the same degree of care as the Recipient would protect its own Confidential Information, but in no event with less
than a commercially reasonable degree of care;
(b) not use the Disclosing Party's Confidential Information, or permit it to be accessed or used, for any purpose other than the Purpose or any related transactions between the Parties, or otherwise in any manner
to the Disclosing Party's detriment, including without limitation, to reverse engineer, disassemble, decompile or design around the Disclosing Party's proprietary services, products and/or confidential intellectual property;
(c) not disclose any such Confidential Information to any person or entity, except to the extent necessary, Recipient's Representatives and insurance carriers and wholesalers who:
(i) need to know the Confidential Information to assist the Recipient, or act on its behalf, in relation to the Purpose or to exercise its rights under the Agreement;
(ii) are informed by the Recipient of the confidential nature of the Confidential Information; and
(iii) are subject to confidentiality duties or obligations to the Recipient that are no less restrictive than the terms and conditions of this Agreement; and
(d) be responsible for any breach of this Agreement caused by any of its Representatives."

Exceptions.  Nothing contained herein shall prohibit or limit either party’s use, disclosure, reproduction or dissemination of information which:
(a)	is or becomes available in the public domain through no fault or breach on the part of the party;
(b)	was lawfully known to the party (without restriction on disclosure) prior to disclosure by the other;
(c)	has been or is hereafter furnished to the party without restriction on disclosure by a third person or entity lawfully in possession thereof;
